              <div>About</div>
            </a>
            <a href="#">
              <div>Contact</div>
            </a>
            <a href="#">
              <div>
                <FontAwesomeIcon icon={faFaceMehBlank} className='icon' />
              </div>
            </a>
          </div>
      </header>
      <body className='body'>
        <h1>Welcome to ProjectVault</h1>
        <p>Explore the perfect projects for your academic requirements, with all source codes, reports, included</p>
        <form onSubmit={handleSubmit} className='form'>

        <div className='dropdown'>
          <button className="dropdown-box" onclick="handleOption1Change">{selectedOption2}</button>
          <div className="dropdown-box-options">
            <a className='option' href="#home">Home</a>
            <a className='option' href="#about">About</a>
            <a className='option' href="#contact">Contact</a>
          </div>
        </div>

        <div className='dropdown'>
          <button className="dropdown-box" onclick="">{selectedOption2}</button>
          <div className="dropdown-box-options">
            <a className='option' href="#home">Home</a>
            <a className='option' href="#about">About</a>
            <a className='option' href="#contact">Contact</a>
          </div>
        </div>

        {/* <div className='dropdown'> */}
        {/* <select className="dropdown-box" value={selectedOption2} onChange={handleOption2Change}>
          <option value="">Select Option 2</option>
          {options2.map((option) => (
            <option key={option.value} value={option.value}>
              {option.label}
            </option>
          ))}
        </select>
        </div> */}

        <button type="submit">Submit</button>
      </form>
      </body>
